    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1647309015193,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1647383415385,"commentText":"<div>In this playback I will answer the question, \"How long does each dog stay at the adoption center before being adopted by location?\"</div><div><br></div>The attached picture shows the ER Diagram. Dogs are adopted by clients. There are two foreign keys in the Dogs table. One links to the client who adopted a dog and the other links to the location the dog is housed in.<br>","selectedCodeBlocks":[],"imageURLs":["media/images/1647383393158-IMG_95F901425392-1.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-56":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-56","timestamp":1647309044823,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":56,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-55","lineNumber":3,"column":36,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647310297045,"commentText":"I start by displaying all of the dogs who have been adopted. I rely on the foreign key between the Dogs and Clients table. If the foreign key is not null then I know that the dog has been adopted.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"SELECT *\nFROM Dogs\nWHERE adoptedByClientId IS NOT NULL","startRow":0,"startColumn":0,"endRow":2,"endColumn":35}],"imageURLs":["media/images/1647309749157-Screen Shot 2022-03-14 at 9.02.11 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT *\nFROM Dogs\nWHERE adoptedByClientId IS NOT NULL;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-107":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-107","timestamp":1647309054570,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":107,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-106","lineNumber":1,"column":57,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647383467916,"commentText":"<div>Here I am limiting the attributes so I can see the relevant dog information including the arrival date and the adoption date.</div><div><br></div><div>I would like to find the difference between the two dates on each row. Most DBMS's have their own functions that allow you to manipulate dates. <br></div><div><br></div><div>In the next step I'll be showing one of <a href=\"https://www.sqlite.org/lang_datefunc.html\">SQLite's date() functions</a>. You should check your DBMS's documentation for more information.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"name, temperament, age, adoptedOnDate, arrivalDate","startRow":0,"startColumn":7,"endRow":0,"endColumn":57}],"imageURLs":["media/images/1647309810363-Screen Shot 2022-03-14 at 9.03.13 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"2","currentFilePath":"/q.sql","viewableBlogText":"SELECT name, temperament, age, adoptedOnDate, arrivalDate\nFROM Dogs\nWHERE adoptedByClientId IS NOT NULL;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-169":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-169","timestamp":1647309074041,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":169,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-168","lineNumber":1,"column":119,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647383523496,"commentText":"<div>From the SQLite documentation:<br></div><div><i>The julianday() function returns the Julian day - the fractional number of days since noon in Greenwich on November 24, 4714 B.C. (Proleptic Gregorian calendar).</i></div><div><br></div><div>When I pass in a date in this format, <font face=\"Courier\">YYYY-MM-DD</font>, the function returns the number of days since the Julian day. <br></div><div><br></div><div>If I pass in two dates I can subtract the results to find the difference in whole days between two dates. I give this column the name <font face=\"Courier\">numDays</font> to represent the number of days it took for a dog to get adopted.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"julianday(adoptedOnDate) - julianday(arrivalDate)","startRow":0,"startColumn":59,"endRow":0,"endColumn":108}],"imageURLs":["media/images/1647309863197-Screen Shot 2022-03-14 at 9.04.06 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT name, temperament, age, adoptedOnDate, arrivalDate, julianday(adoptedOnDate) - julianday(arrivalDate) AS numDays","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-228":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-228","timestamp":1647309092435,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":228,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-227","lineNumber":4,"column":58,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647383551891,"commentText":"Here I order the results by the length of time it took for a dog to be adopted. The <font face=\"Courier\">julianday</font> function can be used in an <font face=\"Courier\">ORDER BY</font> clause.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ORDER BY julianday(adoptedOnDate) - julianday(arrivalDate)","startRow":3,"startColumn":0,"endRow":3,"endColumn":58}],"imageURLs":["media/images/1647309918636-Screen Shot 2022-03-14 at 9.05.01 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT name, temperament, age, adoptedOnDate, arrivalDate, julianday(adoptedOnDate) - julianday(arrivalDate) AS numDays\nFROM Dogs\nWHERE adoptedByClientId IS NOT NULL\nORDER BY julianday(adoptedOnDate) - julianday(arrivalDate);","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-327":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-327","timestamp":1647309322714,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":327,"type":"INSERT","fileId":"fileId-0","character":".","previousNeighborId":"ev-326","lineNumber":1,"column":12,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1647383586971,"commentText":"Here I add the Locations table and join it with the results so far.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Locations","startRow":1,"startColumn":11,"endRow":1,"endColumn":20},{"fileId":"fileId-0","selectedText":"Dogs.locationId = Locations.id","startRow":2,"startColumn":6,"endRow":2,"endColumn":36}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"2","currentFilePath":"/q.sql","viewableBlogText":"SELECT Dogs.name, temperament, age, adoptedOnDate, arrivalDate, Locations.name AS locationName, julianday(adoptedOnDate) - julianday(arrivalDate) AS numDays\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND adoptedByClientId IS NOT NULL\nORDER BY Locations.name, julianday(adoptedOnDate) - julianday(arrivalDate);","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-5","displayCommentEvent":{"id":"ev-327","timestamp":1647309322714,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":327,"type":"INSERT","fileId":"fileId-0","character":".","previousNeighborId":"ev-326","lineNumber":1,"column":12,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1647383679364,"commentText":"<div>Next, I order the results by location name first and length of stay second. Then I display the location name.</div><div><br></div><div>I perform this step just so I can see what the data looks like before I use <font face=\"Courier\">GROUP BY</font>. This is immensely helpful when building queries with <font face=\"Courier\">GROUP BY</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Locations.name AS locationName","startRow":0,"startColumn":64,"endRow":0,"endColumn":94},{"fileId":"fileId-0","selectedText":"Locations.name","startRow":4,"startColumn":9,"endRow":4,"endColumn":23}],"imageURLs":["media/images/1647310037188-Screen Shot 2022-03-14 at 9.06.50 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT Dogs.name, temperament, age, adoptedOnDate, arrivalDate, Locations.name AS locationName, julianday(adoptedOnDate) - julianday(arrivalDate) AS numDays\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND adoptedByClientId IS NOT NULL\nORDER BY Locations.name, julianday(adoptedOnDate) - julianday(arrivalDate);","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-481":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-481","timestamp":1647309659780,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":481,"type":"INSERT","fileId":"fileId-0","character":"n","previousNeighborId":"ev-480","lineNumber":1,"column":121,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1647311528987,"commentText":"To wrap things up I <font face=\"Courier\">GROUP BY</font> the location name and then display the name along with the average of the difference between the arrival and adoption dates.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"AVG(julianday(adoptedOnDate) - julianday(arrivalDate)) AS avgNumDaysBeforeAdoption","startRow":0,"startColumn":39,"endRow":0,"endColumn":121},{"fileId":"fileId-0","selectedText":"GROUP BY Locations.name","startRow":4,"startColumn":0,"endRow":4,"endColumn":23}],"imageURLs":["media/images/1647310104231-Screen Shot 2022-03-14 at 9.08.11 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT Locations.name AS locationName, AVG(julianday(adoptedOnDate) - julianday(arrivalDate)) AS avgNumDaysBeforeAdoption\nFROM Dogs, Locations\nWHERE Dogs.locationId = Locations.id\nAND adoptedByClientId IS NOT NULL\nGROUP BY Locations.name;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}]};
